import React from 'react'

function Home() {
  return (
    <div className='welcomePage'>
      <h1 className='text'>Welcome!</h1>
      <br />
      <div>
        <a href='/login'>
          <button type="submit">Login</button>
        </a>
      </div>
    </div>
  );
}

export default Home
